import React from "react";
import { Link } from "react-router-dom";
import "./inside-cave.css";

// TODO: Make new inside cave component

const Cave = () => {
  return (
    <div className="inside-cave-entrance--container">
      <ul className="inside-cave-entrance--ul">
        <li>
          <Link to="/" className="arrow up">
            {/* Return */}
          </Link>
        </li>
        <li>
          <Link to="/start" className="arrow right">
            {/* Return */}
          </Link>
        </li>
      </ul>
    </div>
  );
};

export default Cave;
